import React from 'react';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <h1>HELLO ASHA</h1>
              </header>
    </div>
  );
}

export default App;
